package com.sj.cy.pay;
public class Music {
	private String m_user;
	private String m_music;
	
	public Music() {
		// TODO Auto-generated constructor stub
	}

	public Music(String m_user, String m_music) {
		super();
		this.m_user = m_user;
		this.m_music = m_music;
	}

	public String getM_user() {
		return m_user;
	}

	public void setM_user(String m_user) {
		this.m_user = m_user;
	}

	public String getM_music() {
		return m_music;
	}

	public void setM_music(String m_music) {
		this.m_music = m_music;
	}
	
	
	
	
}
